INSERT INTO `blog` (`ID`, `Title`, `Author`, `Content`, `Date_Created`, `Image_URL`) VALUES
(1, 'My New Favorite Restaurant Where to stock up on ramen while you grab a bulgogi sandwich for the road.', 'Head Chef Jean Does', 'I think I found the most interesting new restaurant of the year, and it’s in Park Slope of all places. Just off the roundabout on the southwestern tip of Prospect Park is a place called Syko, which is short for “Syrian” and “Korean.” This is not a Syrian-Korean fusion restaurant, mind you, but more like a Syrian-Korean KFC–Taco Bell with each discrete concept represented on its own, down to the customer-facing kitchen counter with mise en place split through the middle according to cuisine. Banchan on the left, grape leaves on the right. It’s my favorite new place to eat.', '2016-11-17', 'images/blog_imgs/blog_img1.png'),
(2, 'A Pizza Obsessive Turns His Attention to Espressos', 'Host Dean Martin', 'When Mangieri was younger, he met his friends at Italian clubs in northern New Jersey. “The espresso was great, but nothing else,” he says. “It was more of a hangout place for guys to play in the back room, smoke cigarettes and berate each other.” But somewhere between those smoky social clubs and numerous trips to Italy, Mangieri worked on his caffeine tolerance and also became a coffee authority. “I sometimes take eight shots a day,” he says. “If you drink a properly brewed espresso.', '2017-05-09', 'images/blog_imgs/blog_img2.png'),
(3, 'Where to Find Itameshi Cooking in New York', 'Owner Gary Dominguez', 'Last week, when I saw that the omakase restaurant Icca had posted about its new “Japanese/Italian” menu on Instagram, I decided to make my way over to Tribeca for some fancy fusion. Although the full sushi menu is served in a different room, I was able to benefit from a zen atmosphere, minimalist decor, and careful service. The high back-bar seats are really comfortable, which is important when you’re splitting two pastas and two risottos with a friend.', '2015-02-05', 'images/blog_imgs/blog_img3.png'),
(4, 'Food prices are up, the quality of service is down, and restaurant pros are doing the unthinkable: staying in on their nights off.', 'Head of Human Resources Richard Johnsonn', 'Anyone who eats out with any kind of frequency will tell you the same thing: Something feels off. There is still much to be happy about — like the fact that so many restaurants are still open at all — but prices are up, portion sizes are down, and ongoing labor woes continue to take a toll on service quality. The situation is difficult, and even the people who work in restaurants (typically enthusiastic customers and big tippers) are questioning the value proposition of a night out.', '2023-08-16', 'images/blog_imgs/blog_img4.png');

